import Link from 'next/link'

const linkStyle = {
    textDecoration: 'none',
    width: '100%',
    fontSize: '25px',
    color: 'rgb(118, 165, 165',
    margin: '20px',
    backgroundColor: 'white'
  }

  const navStyle = {
    borderBottom: '1px solid white',
    paddingBottom: '15px',
    paddingTop: '10px'
  }

const Header = () => (
    <div style={navStyle}>
        <Link href="/">
            <a style={linkStyle}>Home</a>
        </Link>
    </div>
)

export default Header;
